熟悉我的朋友都知道我好爱买买买。回顾2021，我一边检讨自己不该乱买东西，一边总结了下今年买到最值得的东西，就是Purple的枕头。我经常低头看手机，长时间看电脑，加上我驼背，脖子有点前倾，颈椎应该是有点问题的。一到下雨天就会偏头痛，上班全靠ibuprofen。搬家之后去逛床垫，偶然在店里试了purple家的床垫，他家那个特殊的材料像果冻一样。软硬合适而且很透气。但是价格拦下了我[捂脸]床垫就不说了，枕头都要100-150刀一个。黑五的时候8折叠加75折，再减25刀再叠加返利，200刀买了俩Purple枕头。最近又下了几次雨跟雪，我居然没有再偏头痛。有跟我一样偏头痛的朋友可以试试这个枕头。我男朋友一开始还说1千块买个枕头是不是有病，自己睡了后说，明年黑五打折再买两个带回国给爸妈[笑哭R][笑哭R]

